import React from "react";
import { BrowserRouter } from 'react-router-dom';
import { MDBNav, MDBNavLink } from "mdbreact";

const Header = () => (
  <BrowserRouter>

    <MDBNav>
      <MDBNavLink active to="dsf">Active</MDBNavLink>
      <MDBNavLink to="fsd">Link</MDBNavLink>
      <MDBNavLink to="#!">Link</MDBNavLink>
      <MDBNavLink disabled to="#!">Disabled</MDBNavLink>
    </MDBNav>

  </BrowserRouter>
);

export default Header;
